    tempo_list[121351] = {'id': 121351,
                          'tempocomment': 'This took a bit longer than I had initially anticipated to figure out what was going on.  \n\nBasically what was happening is that we have a grid on the preview tab that lists all the chapters in the video.  A user can select a marker and the player will seek to that exact point in the player.\n\nHowever, the grid was broken in the sense that IF the marker was 01:00:00:00 for a video, that meant that it was the start of the video and we were just "showing" 01:00:00:00 in the player.  However, even though the markers grid is displaying that timecode in the grid cell, that is just smoke and mirrors since we are formatting each cell from it\'s original value.  The value that would show up in the cell without us formatting it is 0.  It\'s the length of time that has passed from the start of the video to the marker.  So in this case, if the start timecode is 01:00:00:00, and the marker is 01:00:00:00, the value is actually 0 (0 seconds have passed from the start of the video to the marker).\n\nWith that said, each time a user selects a marker from the grid to seek to that point, a watch is watching the selectedMarker variable and if the user has selected a new marker from the grid, it will run:\n\n{code}\nfunction (newVal) {\n\t\t\t\tif (newVal) {\n\t\t\t\t\tself.selectedArtwork = self.selectedArtworkPartner.assets[0];\n\t\t\t\t}\n\t\t\t});\n{code}\n\nHowever, if the value is 0 that is going into the if statement, the if statement always evaluates to false and thus never seeks to anywhere in the proxy player.\n\nTo remedy this, I am not checking whether or not the newVal is a number, which {code} typeof 0 === \'number\' {code} evaluates to true and fixes this issue.  Once I found the fix it took about 30 seconds.  But finding the issue proved to take a bit longer unfortunately.  ',
                          'tempotime': 10800, 'parentissuetype': 'Bug', 'subkey': None, 'subsummary': None,
                          'subtime': 1415700, 'substatus': None, 'subfixversion': None, 'storykey': 'ABC-8423',
                          'storysummary': 'PROD BUG - Player seek does not point to the marker location when clicked',
                          'storytime': 16200, 'storystatus': 'Testing Complete', 'storyfixversion': '6.5',
                          'epickey': 'ABC-8555', 'epicsummary': '6.5 PROD Bugs', 'epictime': 125100,
                          'epicstatus': 'Testing Complete', 'epicfixversion': '6.5'}
